import React, { useEffect, useState } from "react";
import Svg from "./Svgs";

const Input = () => {
  const [team, setTeam] = useState("rockets");
  return (
    <input
      type="text"
      placeholder="type your fav teams logo"
      onChange={e => setTeam(e.target.value)}
    />
  );
};
